import React, { Component } from 'react';
import './App.css';
import './index.css';
import Navbartwo from './Navbartwo'
import Footer from './Footer'
class App extends Component {
  searchsubmit = () => {
    return false
  }
  render() {
    return (
      <div style={{ backgroundColor: "#d2d2d275" }}>

        <Navbartwo searchsubmit={this.searchsubmit} />

        <Footer />
      </div >
    );
  }
}

export default App;
